DROP TABLE IF EXISTS customers_addresses;
DROP TABLE IF EXISTS customers;
DROP TABLE IF EXISTS addresses;

--
-- Table structure for table ADDRESSES
--

CREATE TABLE addresses (
    add_id        INT AUTO_INCREMENT,
    add_line_1    VARCHAR(255),
    add_line_2    VARCHAR(255),
    add_line_3    VARCHAR(255),
    add_town_city VARCHAR(255),
    add_county    VARCHAR(255),
    add_country   VARCHAR(255),
    add_postcode  VARCHAR(255),
    PRIMARY KEY (add_id)
) ENGINE=InnoDB AUTO_INCREMENT=2002 DEFAULT CHARSET=utf8;

LOCK TABLES addresses WRITE;
UNLOCK TABLES;

--
-- Table structure for table CUSTOMERS
--

CREATE TABLE customers (
    cus_id            INT AUTO_INCREMENT,
    cus_title         VARCHAR(255) NOT NULL,
    cus_first_name    VARCHAR(255) NOT NULL,
    cus_middle_name   VARCHAR(255),
    cus_last_name     VARCHAR(255) NOT NULL,
    cus_job_title     VARCHAR(255) NOT NULL,
    cus_company_name  VARCHAR(255),
    cus_home_phone    VARCHAR(255),
    cus_mobile_phone  VARCHAR(255),
    cus_date_of_birth DATETIME NOT NULL,
    PRIMARY KEY (cus_id)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8;

LOCK TABLES customers WRITE;
UNLOCK TABLES;

--
-- Table structure for table CUSTOMERS_ADDRESSES
--

CREATE TABLE customers_addresses (
    cad_cus_id            INT,
    cad_add_id            INT,
    cad_add_date_from     DATETIME,
    cad_add_date_to       DATETIME,
    PRIMARY KEY (cad_cus_id, cad_add_id, cad_add_date_from),
    FOREIGN KEY (cad_cus_id)
        REFERENCES customers (cus_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (cad_add_id)
        REFERENCES addresses (add_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES customers_addresses WRITE;
UNLOCK TABLES;

--
-- Table structure for table INSURANCE_COMPANIES
--

CREATE TABLE insurance_companies (
    ics_id               INT AUTO_INCREMENT,
    ics_add_id           INT,
    ics_company_name     VARCHAR(255),
    ics_other_details    VARCHAR(255),
    PRIMARY KEY (ics_id),
    FOREIGN KEY (ics_add_id)
        REFERENCES addresses (add_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES insurance_companies WRITE;
UNLOCK TABLES;

--
-- Table structure for table BROKERS
--

CREATE TABLE brokers (
    bkr_id               INT AUTO_INCREMENT,
    bkr_add_id           INT,
    bkr_broker_name      VARCHAR(255),
    bkr_other_details    VARCHAR(255),
    PRIMARY KEY (bkr_id),
    FOREIGN KEY (bkr_add_id)
        REFERENCES addresses (add_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES brokers WRITE;
UNLOCK TABLES;

