-- Table structure for table REF_INS_TYPE
--

CREATE TABLE ref_ins_type (
    ref_ins_type_code       VARCHAR(255),
    ref_ins_type_details    VARCHAR(255),
    PRIMARY KEY (ref_ins_type_code)
