-- Table structure for table REF_CLAIM_OUTCOMES
--

CREATE TABLE ref_claim_outcomes (
    ref_claim_outcome_code      VARCHAR(255),
    ref_claim_outcome_desc      VARCHAR(255),
    PRIMARY KEY (ref_claim_outcome_code)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES ref_claim_outcomes WRITE;
UNLOCK TABLES;

--
-- Table structure for table REF_CLAIM_STATUS_CODES
--

CREATE TABLE ref_claim_status_codes (
    ref_claim_status_code      VARCHAR(255),
