LOCK TABLES ref_claim_status_codes WRITE;
UNLOCK TABLES;

--
-- Table structure for table POLICIES
--

CREATE TABLE policies (
    plc_id                   INT AUTO_INCREMENT,
    plc_ref_ins_type_code    VARCHAR(255),
    plc_bkr_id               INT,
    plc_ics_id               INT,
    plc_other_details        VARCHAR(255),
    PRIMARY KEY (plc_id),
    FOREIGN KEY (plc_ref_ins_type_code)
        REFERENCES ref_ins_type (ref_ins_type_code)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (plc_ics_id)
        REFERENCES insurance_companies (ics_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (plc_bkr_id)
        REFERENCES brokers (bkr_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=2000 DEFAULT CHARSET=utf8;

LOCK TABLES policies WRITE;
UNLOCK TABLES;

--
-- Table structure for table CUSTOMERS_POLICIES
--

CREATE TABLE customers_policies (
    cpy_id                   INT AUTO_INCREMENT,
    cpy_plc_id               INT,
    cpy_cus_id               INT,
    cpy_start_date           DATETIME NOT NULL,
    cpy_renewal_date         DATETIME NOT NULL,
    cpy_premium_payable      DECIMAL(8,2) NOT NULL,
    cpy_policy_details       VARCHAR(255),
    PRIMARY KEY (cpy_id),
    FOREIGN KEY (cpy_plc_id)
        REFERENCES policies (plc_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (cpy_cus_id)
        REFERENCES customers (cus_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=2000 DEFAULT CHARSET=utf8;

LOCK TABLES customers_policies WRITE;
UNLOCK TABLES;

--
-- Table structure for table CLAIMS
--

CREATE TABLE claims (
    clm_id                         INT AUTO_INCREMENT,
    clm_ref_claim_status_code      VARCHAR(255),
    clm_cpy_id                     INT,
    clm_ref_claim_outcome_code     VARCHAR(255),
    clm_date                       DATETIME NOT NULL,
    clm_amount                     INT NOT NULL,
    clm_details                    VARCHAR(255)NOT NULL,
    PRIMARY KEY (clm_id),
    FOREIGN KEY (clm_ref_claim_status_code)
        REFERENCES ref_claim_status_codes (ref_claim_status_code)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (clm_cpy_id)
        REFERENCES customers_policies (cpy_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
    FOREIGN KEY (clm_ref_claim_outcome_code)
        REFERENCES ref_claim_outcomes (ref_claim_outcome_code)
        ON UPDATE CASCADE ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=492 DEFAULT CHARSET=utf8;

LOCK TABLES claims WRITE;
UNLOCK TABLES;

